"use strict";(self.webpackChunkmyBlog_aurora=self.webpackChunkmyBlog_aurora||[]).push([[729],{6805:(e,p,a)=>{a.r(p),a.d(p,{data:()=>t});const t={key:"v-62f43d42",path:"/myOwn/novels/original/origin.html",title:"诸始",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[],git:{updatedTime:1694929033e3,contributors:[{name:"‘Veh7’",email:"‘925779572@qq.com’",commits:1}]}}},1856:(e,p,a)=>{a.r(p),a.d(p,{default:()=>o});const t=(0,a(6252).uE)('<h1 id="诸始" tabindex="-1"><a class="header-anchor" href="#诸始" aria-hidden="true">#</a> 诸始</h1><blockquote><p>轰隆~轰</p><p>烟火色的天上的确是深蓝渐黑的层云，层云向内反卷，她积攒力量。</p><p>轰~唰</p><p>再一次的雷鸣击碎了那沉碍的云披，大雨倾刷着大地。</p><p>雨中，</p><p>那对男女在狂舞，无他欲念，只想舞动，舞给对方。</p><p>目光看着对方，双臂摇摆，上下欢震。</p><p>女儿转身漩侧，眼光深情望着目中人，身体由于这份欢悦，跃若缠蟒，是的，她想将自己的宿命、身体、灵魂全都交给眼前这个人，全都交给的选自己的选择。此身此生是此愿。</p><p>男儿震似动霆，遨犹鱼龙在水，自在若身。天上之雨击打在坚定的双眼，雨滴中映若女儿身。激动的心，蓬勃的气，掩盖不住的痴迷。痴迷她的笑、醉饮她的姿。曼妙中迷醉，迷醉中震明，震明中若返，怎么停下来。不知，亦是不愿？</p><p>忽而，身后人影在宿。他们也在舞，舞祖之姿。愈舞愈众，众影随行</p></blockquote>',2),r={},o=(0,a(3744).Z)(r,[["render",function(e,p){return t}]])}}]);